void SysTick_Init (unsigned long period)
{	
		NVIC_ST_CTRL_R = 0;                   												// disable SysTick during setup
		NVIC_ST_RELOAD_R = period -1;  																// maximum reload value
		NVIC_ST_CURRENT_R = 0;                												// any write to current clears it
		NVIC_SYS_PRI3_R = (NVIC_SYS_PRI3_R&0x00FFFFFF)|0x4000000; 		// priority 0    																		
		NVIC_ST_CTRL_R = 0x00000007;																	// enable SysTick with core clock
}


void PortF_Init(void){							//Port F Initilization 
	volatile int delay;								//PF2 is heartbeat
	SYSCTL_RCGCGPIO_R |= 0x20;
	delay = SYSCTL_RCGCGPIO_R;
	delay = SYSCTL_RCGCGPIO_R;
	GPIO_PORTF_DIR_R |= 0x07;
	GPIO_PORTF_AFSEL_R &= ~0x07;
	GPIO_PORTF_DEN_R |= 0x07;
}


void PortB_Init(void){							//Port B Initialization
	volatile uint32_t delay;					//Configures 3 buttons (P1 Kick, P2 Kick, and Game Reset)
	SYSCTL_RCGC2_R			|= 0x32;
	delay	= SYSCTL_RCGC2_R;
	delay	= SYSCTL_RCGC2_R;
	GPIO_PORTB_DIR_R		&= ~0xC0;
	GPIO_PORTB_AFSEL_R	&= ~0xC0;
	GPIO_PORTB_DEN_R		|= 0xC0;
	GPIO_PORTB_AMSEL_R	&= ~0xC0;
	GPIO_PORTB_PCTL_R		&= ~0xFF000000;
}

void PortA_Init(void){							//Port B Initialization
	volatile uint32_t delay;					//Configures 3 buttons (P1 Kick, P2 Kick, and Game Reset)
	SYSCTL_RCGC2_R			|= 0x31;
	delay	= SYSCTL_RCGC2_R;
	delay	= SYSCTL_RCGC2_R;
	GPIO_PORTA_DIR_R		&= ~0x10;
	GPIO_PORTA_AFSEL_R	&= ~0x10;
	GPIO_PORTA_DEN_R		|= 0x10;
	GPIO_PORTA_AMSEL_R	&= ~0x10;
	GPIO_PORTA_PCTL_R		&= ~0x000F0000;
}


unsigned long TimerCount;
void Timer2_Init(unsigned long period){ 
  unsigned long volatile delay;
  SYSCTL_RCGCTIMER_R |= 0x04;   // 0) activate timer2
  delay = SYSCTL_RCGCTIMER_R;
  TimerCount = 0;
  TIMER2_CTL_R = 0x00000000;   // 1) disable timer2A
  TIMER2_CFG_R = 0x00000000;   // 2) 32-bit mode
  TIMER2_TAMR_R = 0x00000002;  // 3) periodic mode
  TIMER2_TAILR_R = period-1;   // 4) reload value
  TIMER2_TAPR_R = 0;           // 5) clock resolution
  TIMER2_ICR_R = 0x00000001;   // 6) clear timeout flag
  TIMER2_IMR_R = 0x00000001;   // 7) arm timeout
  NVIC_PRI5_R = (NVIC_PRI5_R&0x00FFFFFF)|0x80000000; 
// 8) priority 4
  NVIC_EN0_R = 1<<23;          // 9) enable IRQ 23 in
  TIMER2_CTL_R = 0x00000001;   // 10) enable timer2A
}

void Timer2A_Stop(void){ 
  TIMER2_CTL_R &= ~0x00000001; // disable
}

void Timer2A_Start(void){ 
  TIMER2_CTL_R |= 0x00000001;   // enable
}
	
void Timer2A_Handler(void){
  DAC_Out(wave[Index]);	
	Index = (Index+1)&0x3F;
	TIMER2_ICR_R = 0x00000001;  // acknowledge TIMER1A timeout
}




