//Converts ADC output to pixel amount to shift players
uint32_t Convert(uint32_t input){							
  input = round((input-44.0)/84.0);
	return input;
}

void IncreaseVelocity (void){
			if (Xoffset < 0 && Xoffset >-3)
				Xoffset--;
			if (Xoffset > 0 && Xoffset < 3)
				Xoffset++;
			if (Yoffset < 0 && Yoffset >-3)
				Yoffset--;
			if (Yoffset > 0 && Yoffset < 3)
				Yoffset++;
}

