		PLL_Init();
		SysTick_Init(2000000);
		PortA_Init();
		PortF_Init();
		PortB_Init();
		ADC_Init();
		Timer2_Init(2400);
		Timer2A_Stop();
		DAC_Init();
		ST7735_InitR(INITR_REDTAB);
